import { useEffect, useState } from "react"
import { URL_ESTRUTURA_ORGANIZACIONAL_RESUMIDA } from "../../utils/constants";
import { Unidade } from "../../types/Unidade";
import { mapUnidade } from "../../utils/maps";


const Estrutura = () => {
    const [unidades, setUnidades] = useState<Unidade[]>();

    useEffect(() => {
        fetch(URL_ESTRUTURA_ORGANIZACIONAL_RESUMIDA(26)).then(req => {
            req.json().then(r => {
                setUnidades(mapUnidade(r.unidades))
            })
        })
    }, [])

    return <>{JSON.stringify(unidades)}</>
}

export default Estrutura
